import React from 'react';
import {Text, View, Button, FlatList, StyleSheet, Image} from 'react-native';
import Hackerrank from './images/img_hakerrank.png'


const SitesContainer=(props)=>{

    return(
    <View style={styles.itemContainer}>
        <Image style={styles.image}source={Hackerrank}></Image>
        <Text>Hackerrank</Text>
    </View>  
    )  

}

const data = (
    {
        name:"Hackerrank",
        source:{Hackerrank},
    }
)


class SiteScreen extends React.Component{

    constructor(props){
        super(props);
    }

    render()
    {
        return(
            <View style={styles.container}>
                <SitesContainer/>
            </View>     
            );
    }
    


}

const styles = StyleSheet.create({
    container:{
        display:flex,
        flex:1,
        alignItems:'center',
        justifyContent:'center',
    },
    itemContainer:{
        height:200,
        width:200,
    },
    image:{
        flex:1,
        height:100,
        width:100,
        resizeMode:'contain',
    }
})




export default SiteScreen;
